import Modal from "./components/atoms/Modal/Modal";

function App() {
  const img = "/assets/icons/Bitmap.svg";
  return (
    <BrowserRouter>
      <div>
        <FloatingLabelInput labelText="Email" placeholderText="email@email.com"/> 
        <InputPass placeholderText="Password"/>
        <br />
        <Button text={"LOG IN"} onClick={()=> console.log("click")}/>
        <Modal isOpen={true}/>
      </div>
    </BrowserRouter>
  );
}

export default App;
